import React, { useState } from 'react';

function DodajUzytkownika() {
  // Zdefiniuj stan dla hasła
  const [password, setPassword] = useState("");

  // Definiuj funkcję do generowania losowego hasła
  const generatePassword = () => {
    const newPassword = Math.random().toString(36).substring(2, 10); // Generuj losowe hasło
    setPassword(newPassword); // Ustaw nowe hasło
  };

  return (
  <>
  <div className='dodajUzytkownika'>
    <div className='COL11'>
        <div>Imię</div>
        <div>Nazwisko</div>
        <div>Data urodzenia</div>
        <div>PESEL</div>
        <div>Adres</div>
        <div>Adres</div>
        <div>Hasło</div>
      </div>

      <div className='COL22'>
        <input></input>
        <input></input>
        <input></input>
        <input></input>
        <input></input>
        <input></input>
        <input value={password}></input> {/* Ustaw wartość dla pola hasło */}

      </div>
      <div className='generujHasloDiv'>
        <button onClick={generatePassword}>Generuj hasło</button> {/* Wywołaj funkcję generatePassword po kliknięciu */}
      </div>
    </div>
  </>
  );
};

export default DodajUzytkownika;
